                }}
              >
                <div>
                  <i
                    className="fa fa-server mb-3"
                    style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                    aria-hidden="true"
                  ></i>
                </div>
                <div className="mt-3" style={{ color: "black" }}>
                  BACK END
                </div>
                <div
                  className="SkillsCardLayover rounded"
                  style={{ backgroundColor: "#b3c3de" }}
                >
                  <ul
                    style={{
                      listStyleType: "none",
                      borderBottom: "1px",
                      textAlign: "center",
                      padding: "0.5rem",
