                style={{
                  width: "250px",
                  justifyContent: "center",
                  opacity: "0.9",
                  backgroundColor: "white",
                }}
              >
                <div>
                  <i
                    className="fa fa-cloud mb-3"
                    style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                    aria-hidden="true"
