                        borderBottom: "1px solid #eee",
                        padding: "0.5rem",
                      }}
                    >
                      react | Redux
                    </li>
                    <li
                      style={{
                        borderBottom: "1px solid #eee",
                        padding: "0.5rem",
                      }}
                    >
                      Heroku
                    </li>
                    <li
                      style={{
                        borderBottom: "1px solid #eee",
                        padding: "0.5rem",
                      }}
                    >
