}

const MainDiv = {
  marginTop: "70px",
  // height: window.innerHeight,
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontWeight: "bold",
  fontSize: "22px",
  // fontFamily: "playfair display",
  color: "white",
  margin: "1%",
  padding: "5%",
  // textAlign: "left",
